column25:
Prédio imponente, 100% revestido, com elevador, 9 andares sendo uma unidade por andar. 
 Lazer: Piscina, espaço gourmet e salão de festas.
 Apartamento com 114,61m², claro , arejado com ótima divisão interna:
 •	Sala para dois ambientes, piso em porcelanato 1x1m, varanda;
 •	4 quartos sendo um com suíte e todos com armários piso em tábua corrida;
 •	Cozinha com armários, piso e bancadas em granito;
 •	Banho social e suíte com bancadas em granito espelhos e armários.
 •	Área de serviço com quarto e banho.
 Garagem: 2 vagas em linha no pilotis
